■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>濃いヒゲも素早くカット!!4枚刃パワフルモデル。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1070432-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="1200" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1070432-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="456" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1070432-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="468" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1070432-04.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">肌への接触面が広く、一度に多くのヒゲを素早くカットできる、早剃り4枚刃シェーバーです。電池が切れた時にはコードを繋いでも使える、充電/交流両用式。ポップアップトリマーがついているので、剃りにくいクセヒゲを剃るときや、モミアゲのお手入れに便利です。また自動電圧切替機能により、アメリカ、カナダ、グアムなどのA2プラグ地域であれば海外でも使用可能です。防水設計なので、本体丸ごと水洗いが可能です。</font></td></tr></table><br><!--その他アレルギーここから--><!--保存方法と製造（販売）者情報ここから--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">肌への接触面が広く、一度に多くのヒゲを素早くカットできる、早剃り4枚刃シェーバーです。電池が切れた時にはコードを繋いでも使える、充電/交流両用式。ポップアップトリマーがついているので、剃りにくいクセヒゲを剃るときや、モミアゲのお手入れに便利です。また自動電圧切替機能により、アメリカ、カナダ、グアムなどのA2プラグ地域であれば海外でも使用可能です。防水設計なので、本体丸ごと水洗いが可能です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">W6.2×D4.3×H15.7cm</font><br><font color="#333333" size="-1">個装サイズ：7×12×20cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約170g</font><br><font color="#333333" size="-1">個装重量：388g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">電源:充電/交流 両用式(AC100-240V・50/60Hz)<br>充電コード長さ:1.8m<br>蓄電池:Li-ion<br>充電時間:約2時間<br>使用日数:約28日※<br>刃の動作方式:往復式<br>防水設計:IPX7基準<br>海外対応:AC100-240V 自動電圧切替(A2プラグ地域)<br>■機能■<br>4枚刃<br>5LED表示(5段階充電残量/充電催促/充電中/充電完了/ターボモード)<br>ポップアップ トリマー<br>スリムボディ デザイン<br>本体丸洗い可<br>低振動、低騒音設計<br>外刃独立上下フロート<br>大型電源スイッチ<br><br>※満充電状態で、1日1回約3分間使用した場合の使用可能日数。</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">ポーチ<br>掃除用ブラシ<br>キャップ<br>取扱説明書<br>保証書(1年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国(刃:日本)</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
